[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_25004B000350534E4E313020-if00

[input_shaper]
shaper_freq_x: 64.0
shaper_type_x: mzv
damping_ratio_x: 0.055
shaper_freq_y: 37.6
shaper_type_y: mzv
damping_ratio_y: 0.066

[exclude_object]

[force_move]
